import styled from 'styled-components'
import { useMemo } from 'react'
import { useTable } from 'react-tables'
import axios from 'axios'

const COLUMNS = [
    {
        Header: 'Remote Id',
        accessor: 'remoteId'
    },
    {
        Header: 'Order Lines',
        accessor: 'productLines'
    }
]


const OrderListView = () => {
    
    const columns = useMemo(() => COLUMNS, [])


    return (
        <div>
            OrderListView
        </div>
    )
}

export default OrderListView
